-- ----------------------------
-- Function structure for SG_ENVIO_BACKLOG
-- ----------------------------
CREATE OR REPLACE
PROCEDURE "APP_SGD"."SG_ENVIO_BACKLOG" AS
BEGIN
	
			ATIVIDADE, 
			MOTIVO, 
			USUARIO
		) VALUES
		(
			'Envio backlog - Início',
			'Processo automatico de backlog',
			'SISTEMA'
		);

	FOR dados IN grupoDemandas LOOP
				ATIVIDADE, 
				MOTIVO, 
				USUARIO, 
				DEMANDA_ID
			) VALUES
			(
				'Envio backlog',
				'Processo automatico de backlog',
				'SISTEMA',
				dados.ID
			);

	END LOOP;
	
			ATIVIDADE, 
			MOTIVO, 
			USUARIO
		) VALUES
		(
			'Envio backlog - Fim',
			'Processo automatico de backlog',
			'SISTEMA'
		);

	UPDATE APP_SGD.DEMANDA SET STATUS_ID = 3 WHERE STATUS_ID = 2 AND TRUNC(PRAZO_CONSIDERADO) - TRUNC(SYSDATE) <= -60;

EXCEPTION
	WHEN others THEN
	
			ATIVIDADE, 
			MOTIVO, 
			USUARIO
		) VALUES
		(
			'Envio backlog - Erro',
			'Processo automatico de backlog',
			'SISTEMA'
		);
		raise_application_error(-20001, 'Ocorreu um erro na manipulação do cursor');

END;
/

