INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('1', 'Tributário', 'Ações da Anatel com o objetivo de apurar os valores devidos ao Fundo de Universalização dos Serviços de Telecomunicações (Fust) e ao Fundo para o Desenvolvimento Tecnológico das Telecomunicações (Funttel), a fim de assegurar o correto recolhimento das contribuições aos fundos, conforme legislação vigente', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('2', 'Plano de Monitoração do Espectro na Fronteira (PMEF)', 'Ações da Anatel sobre análise espectral, a fim de verificar a presença de sinal interferente proveniente de operadora estrangeira em território brasileiro', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('3', 'Grandes Eventos Nacionais', 'Ações da Anatel planejadas para monitoração do espectro, verificação da área de cobertura e outros parâmetros técnicos, a fim de evitar incidentes durantes os eventos', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('4', 'Econômica', 'Ações da Anatel com o objetivo de auditar entidades que possam estar comprometendo a livre competição no mercado e sobre ônus contratual', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('5', 'Espectro', 'Ações da Anatel com o objetivo de detectar entidades operando de forma não autorizada, a fim de adotar providências ou fundamentar alterações na regulamentação vigente', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('6', 'Oferta e contratação de serviços', 'Ações da Anatel com o objetivo de verificar a oferta e contratação de serviços de telecomunicações oferecidos pela própria prestadora ou por eventuais parceiros terceirizados', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('7', 'Radiodifusão', 'Ações da Anatel solicitadas pelo Ministério das Comunicações a fim de verificar parâmetros técnicos das estações e conteúdo obrigatório veiculado nas emissoras de radiodifusão', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('8', 'REPNBL (Regime Especial de Tributação do Programa Nacional de Banda Larga)', 'Ações da Anatel solicitadas pelo Ministério da Ciência, Tecnologia, Inovações e Comunicações (MCTIC) a fim de verificar parâmetros técnicos das estações, recursos de acessibilidade e infraestrutura implantada por meio desse Regime', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('9', 'Qualidade', 'Ações da Anatel destinadas a acompanhar indicadores de qualidade dos serviços de telecomunicações e cumprimento de obrigações legais e contratuais relacionados a qualidade', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('10', 'Direitos e garantias dos usuários', 'Ações da Anatel com o objetivo de verificar o cumprimento do Regulamento Geral de Direitos do Consumidor de Serviços de Telecomunicações (RGC), bem como analisar a infraestrutura de comercialização', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('11', 'Ampliação de acesso, área de cobertura e bens reversíveis', 'Ações da Anatel destinadas a fiscalizar o cumprimento de compromissos de abrangência. Programa Nacional de Banda Larga (PNBL) e Relação de Bens Reversíveis (RBR)', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('12', 'Outorga e Infraestrutura de Redes', 'Ações da Anatel objetivando interromper entidades operando de forma clandestina, bem como averiguar o cumprimento de obrigações legais relacionadas a infraestrutura de redes', '1');
INSERT INTO "APP_SGD"."CLASSIFICACAO" VALUES ('13', 'Continuidade e Universalização', 'Ações da Anatel que se destinam a verificar se as metas e prazos dispostos no Plano Geral de Metas para Universalização (PGMU) estão sendo cumpridos, bem como se os telefones de uso público (TUP) encontram-se em condições de operação, funcionamento e conservação', '1');
